import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Step 1: Wait for dynamic content and rapidly add items ---
    // The page uses JavaScript to render product cards. We wait for the 'Add to Cart' buttons to appear.
    // This selector is based on the provided 'script.js' which creates these buttons.
    await page.waitForSelector('button.add-to-cart', { timeout: 5000 });
    const addToCartButtons = await page.locator('button.add-to-cart').all();

    if (addToCartButtons.length === 0) {
      throw new Error("No 'Add to Cart' buttons found. Dynamic content may not have loaded.");
    }

    // Use Promise.all to click all found buttons rapidly, simulating a stress test.
    await Promise.all(addToCartButtons.map(button => button.click()));

    // --- Step 2: Verify items were added by checking the cart counter ---
    const cartLocator = page.locator('div.cart');
    // Wait for the cart's text content to update from its initial "0" state.
    await page.waitForFunction((cartElement) => !cartElement.textContent.includes('0\n                Cart'), await cartLocator.elementHandle(), { timeout: 5000 });

    const cartTextAfterAdd = (await cartLocator.textContent()).trim();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // --- Step 3: Open the cart view ---
    await cartLocator.click();

    // Wait for the remove buttons to become visible inside the cart modal.
    await page.waitForSelector('button.remove-item', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_view.png'));

    // --- Step 4: Rapidly remove all items from the cart ---
    const removeButtons = await page.locator('button.remove-item').all();
    await Promise.all(removeButtons.map(button => button.click()));

    // --- Step 5: Verify the cart is empty ---
    // The script should display an "empty cart" message.
    const emptyCartMessage = page.getByText('Your cart is empty');
    await emptyCartMessage.waitFor({ state: 'visible', timeout: 5000 });

    const finalCartText = (await cartLocator.textContent()).trim();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_emptied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_emptied.png'));

    return {
      success: true,
      action: "Successfully performed a rapid cart stress test by adding and removing multiple items.",
      extractedData: {
        itemsAdded: addToCartButtons.length,
        cartTextAfterAdd,
        itemsRemoved: removeButtons.length,
        finalCartText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
